import React from 'react';
import { Text, Row, Col } from '../../components/webcomps';
import styled from 'styled-components';

const BodyWrapper = styled(Row)`
  box-shadow: 0px 0px 8px 2px #ffffff;
  align-content: center;
`;
const TextWrapper = styled(Text)`
  font-size: 48px;
  margin:0px;
`;
const HeadSymbol = () => (
  <BodyWrapper>
    <img src="https://img.icons8.com/color/128/000000/matrix-desktop.png" />
    <TextWrapper>W</TextWrapper>
    <Col>
      <TextWrapper>HA</TextWrapper>
      <TextWrapper>CK</TextWrapper>
    </Col>
  </BodyWrapper>
);

export default HeadSymbol;
